import React, { useState } from 'react';
import { login } from '../AuthenticateHelper'; 
import { AuthenticateUser } from '../Api';
import './Login.css';


function Login() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState(''); 

  const handleLogin = async () => {
    try {
      const user = await login(email, password);
      console.log(user.user.accessToken);
    } catch (error) {
      setError('Login failed. Please check your email and password.');
      console.error('Login failed:', error.message);
    }
  };

  useEffect(() => {
    document.body.classList.add('login-page-body');

    return () => {
      document.body.classList.remove('login-page-body');
    };
  }, []);

  // The HTML and CSS for this page was taken from https://github.com/chandantudu/HTML-CSS-login-page-template
  return (
    <div className="main-container">

      <div className="form-container">

        <div className="form-body">
          <h2 className="title">Log in with</h2>

          <div className="social-login">
            <ul>
              <li className="google"><a href="#">Google</a></li>
              <li className="fb"><a href="#">Facebook</a></li>
            </ul>
          </div>

          <div className="_or">or</div>

          <form className="the-form">
            <label htmlFor="email">Email</label>
            <input type="email" name="email" id="email" placeholder="Enter your email" />

            <label htmlFor="password">Password</label>
            <input type="password" name="password" id="password" placeholder="Enter your password" />

            <input type="submit" value="Log In" />
          </form>
        </div>

        <div className="form-footer">
          <div>
            <span>Don't have an account?</span> <a href="#">Sign Up</a>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Login;
